define({"topics" : [{"title":"Basic Syntax","shortdesc":"\n               <p class=\"shortdesc\">Precede all expressions with a dollar sign and enclose them with curly brackets, as   follows: <code class=\"ph codeph\">${&lt;expression&gt;}</code>.\n               </p>\n            ","href":"datacollector\/UserGuide\/Pipeline_Configuration\/Expressions.html#concept_bkb_tcm_xq","attributes": {"data-id":"concept_bkb_tcm_xq",},"menu": {"hasChildren":false,},"tocID":"concept_bkb_tcm_xq-d46e43386","topics":[]},{"title":"Using Field Names in Expressions","href":"datacollector\/UserGuide\/Pipeline_Configuration\/Expressions.html#concept_kk2_mbm_xq","attributes": {"data-id":"concept_kk2_mbm_xq",},"menu": {"hasChildren":true,},"tocID":"concept_kk2_mbm_xq-d46e43414","next":"concept_kk2_mbm_xq-d46e43414",},{"title":"Referencing Field Names and Field Paths","shortdesc":"\n               <p class=\"shortdesc\">When a pipeline is valid for preview, you can generally select fields from a list. When                 a list is not available\n                  or when you are defining a new field name, you need to use                 the appropriate format for the field name.  \n               </p>\n            ","href":"datacollector\/UserGuide\/Pipeline_Configuration\/Expressions.html#concept_hjk_b4l_vq","attributes": {"data-id":"concept_hjk_b4l_vq",},"menu": {"hasChildren":true,},"tocID":"concept_hjk_b4l_vq-d46e43491","next":"concept_hjk_b4l_vq-d46e43491",},{"title":"Field Path Expressions","shortdesc":"\n               <p class=\"shortdesc\"></p>\n            ","href":"datacollector\/UserGuide\/Pipeline_Configuration\/Expressions.html#concept_ir4_rxt_3cb","attributes": {"data-id":"concept_ir4_rxt_3cb",},"menu": {"hasChildren":true,},"tocID":"concept_ir4_rxt_3cb-d46e43612","next":"concept_ir4_rxt_3cb-d46e43612",},{"title":"Data Type Coercion","shortdesc":"\n               <p class=\"shortdesc\">When an expression requires, the expression language attempts implicit data type   conversion - called data type coercion.\n                  When coercion is not possible, <span class=\"ph\">Data Collector</span> passes the   error records to the stage for error handling.\n               </p>\n            ","href":"datacollector\/UserGuide\/Pipeline_Configuration\/Expressions.html#concept_fmr_ggh_fr","attributes": {"data-id":"concept_fmr_ggh_fr",},"menu": {"hasChildren":false,},"tocID":"concept_fmr_ggh_fr-d46e43862","topics":[]}]});